import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

// Helper function to generate a timestamped session ID
const generateTimestampedSessionId = () => {
    const now = new Date();
    const datePart = now.getFullYear() + "-" + String(now.getMonth() + 1).padStart(2, '0') + "-" + String(now.getDate()).padStart(2, '0');
    const timePart = String(now.getHours()).padStart(2, '0') + "-" + String(now.getMinutes()).padStart(2, '0') + "-" + String(now.getSeconds()).padStart(2, '0');
    return `${datePart}_${timePart}`;
};

function SessionInitialization() {
    const navigate = useNavigate();

    // State variables for user inputs
    const [studyId, setStudyId] = useState(localStorage.getItem('studyId') || "");
    const [name, setName] = useState(localStorage.getItem('name') || "");
    const [smartphoneIp, setSmartphoneIp] = useState(localStorage.getItem('smartphoneIp') || "192.168.4.245");

    // The session ID will now be automatically generated
    const [sessionId, setSessionId] = useState("");

    // Derived values for the backend
    const [savePath, setSavePath] = useState("");

    // UI state
    const [message, setMessage] = useState("");

    // Use a useEffect hook to generate a new timestamped session ID when the component first loads
    useEffect(() => {
        // Set a new timestamped session ID only if it's not already set
        if (!sessionId) {
            setSessionId(generateTimestampedSessionId());
        }
    }, [sessionId]);

    // Use another useEffect to update the derived save path and localStorage whenever inputs change
    useEffect(() => {
        if (studyId && sessionId) {
            setSavePath(`data/${studyId}/${sessionId}`);
        } else {
            setSavePath("data");
        }

        // Save studyId, name, and smartphoneIp to localStorage for persistence
        localStorage.setItem('studyId', studyId);
        localStorage.setItem('name', name);
        localStorage.setItem('smartphoneIp', smartphoneIp);
    }, [studyId, sessionId, name, smartphoneIp]);

    const handleGoToCalibration = () => {
        if (!studyId || !sessionId) {
            setMessage("Error: Please enter a Study ID and ensure a Session ID is set.");
            return;
        }
        
        navigate('/calibration');
    };

    return (
        <div style={{ padding: "2rem", maxWidth: "800px", margin: "0 auto" }}>
            <h2>Session Initialization</h2>
            <p>Enter the details to start a new recording session on the smartphone.</p>

            <h3 style={{ marginTop: "2rem" }}>Session Details</h3>
            <div style={{ marginBottom: "1rem" }}>
                <label htmlFor="study-id">Study ID:</label>
                <input
                    type="text"
                    id="study-id"
                    value={studyId}
                    onChange={(e) => setStudyId(e.target.value)}
                    style={{ marginLeft: "0.5rem", padding: "8px" }}
                    placeholder="e.g., Study_ABC"
                />
            </div>
            <div style={{ marginBottom: "1rem" }}>
                <label htmlFor="session-id">Session ID:</label>
                <input
                    type="text"
                    id="session-id"
                    value={sessionId}
                    onChange={(e) => setSessionId(e.target.value)}
                    style={{ marginLeft: "0.5rem", padding: "8px" }}
                    placeholder="Auto-generated, but can be edited"
                />
            </div>
            <div style={{ marginBottom: "1rem" }}>
                <label htmlFor="name">Video Name Prefix:</label>
                <input
                    type="text"
                    id="name"
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                    style={{ marginLeft: "0.5rem", padding: "8px" }}
                    placeholder="e.g., baseline_trial"
                />
            </div>
            <div style={{ marginBottom: "1rem" }}>
                <label htmlFor="smartphone-ip">Smartphone IP:</label>
                <input
                    type="text"
                    id="smartphone-ip"
                    value={smartphoneIp}
                    onChange={(e) => setSmartphoneIp(e.target.value)}
                    style={{ marginLeft: "0.5rem", padding: "8px" }}
                    placeholder="e.g., 192.168.1.100"
                />
            </div>

            <h3 style={{ marginTop: "2.5rem" }}>Next Step</h3>
            <div style={{ marginBottom: "1rem", border: '1px solid #ccc', padding: '1rem' }}>
                <p><strong>Save Path:</strong> <code>{savePath || "Not set"}</code></p>
            </div>
            <button
                onClick={handleGoToCalibration}
                disabled={!studyId || !sessionId}
                style={{ padding: "10px 20px", fontSize: "1rem" }}
            >
                Go to Calibration
            </button>
            {message && <p style={{ marginTop: "1rem", color: 'red' }}>{message}</p>}
        </div>
    );
}

export default SessionInitialization;
